            <message id="290Toll">

              Project Cost: $402 Million. Project Length: 6.2-miles. Opening Date: Phase I (2012), Phase II (2014), Phase III (Anticipated Opening Date 2020). Speed Limit: 60 MPH. Shared Use Path: 5-miles.
            </message>

          <a href="#MoPac_Group" role="img" aria-labelledby="Mo_Pac" tabindex="0" id="MoPac_Group">
            <message id="Mo_Pac">
              MoPac Express Lane. The MoPac Express Lane gives drivers the option to bypass congestion on the 11-mile stretch of MoPac from Cesar Chavez Street in downtown Austin to Parmer Lane by adding an Express Lane in each direction. The project was created as an effort to address the corridor's mobility problem and takes into account the needs of drivers, transit riders, pedestrians,
              bicyclists, and preserves quality of life for surrounding neighbors. Phase: Open to Traffic. Project Cost: $222 Million. Project Length: 11-miles. Opening Date: Fully Open to Traffic as of October 2017. Speed Limit: MoPac/Loop 1: 65 MPH. Toll Rate: Variable. Shared Use Path: 3.5-miles.
            </message>

        <g id="183A_Toll" class="toll-line enabled open" data-name="183A Toll Phases I and II" role="listitem">
          <a href="#183A_TollGroup" role="img" aria-labelledby="183AToll" tabindex="0" id="183A_TollGroup">
            <message id="183AToll">
              183A Toll Phases I and II. The 183A Toll is an 11.6-mile roadway extending from northwest Austin through Cedar Park and Leander in northwest Williamson County. The project, which consists of tolled mainlanes with non-tolled frontage roads at the north end, has significantly improved travel times and reduced traffic on adjacent roadways, including US 183. Phase: Open to Traffic.
              Project Cost: $349 Million. Project Length: Phase I 11.6-miles (Expressway 4.5-miles, Frontage Roads 7.1-miles) Phase II Expressway (5-miles). Opening Date: Phase I (2007), Phase II (2012). Speed Limit: 75 MPH. Toll Rate: Discussions in progress on how to incorporate the toll rate table. Shared Use Path: 7-miles.
            </message>

        <g id="71_Toll" class="toll-line enabled open" data-name="71 Toll" role="listitem">
          <a href="#71_TollGroup" role="img" aria-labelledby="71Toll" tabindex="0" id="71_TollGroup">
            <message id="71Toll">
              71 Toll. SH 71 serves as a major corridor connecting drivers to the Austin-Bergstrom International Airport (ABIA), the city of Bastrop, and points beyond. The 71 Toll Lane project adds a toll lane in each direction along SH 71 from near Presidential Boulevard at ABIA and extending east near SH 130. These new lanes offer a free-flowing and reliable bypass route for through-traffic,
